import Header from "./Header";
import Footer from "./Footer";
import HeadTag from "./HeadTag";
import "../fonts/fonts.scss";

const layoutStyle = {
  // margin: 20,
  // padding: 20,
  // background: "#17a2b8",
  // border: "1px solid #DDD"
};

const withLayout = Page => {
  return () => (
    <div style={layoutStyle}>
      <HeadTag />
      <Header />
      <Page />
      <Footer />
    </div>
  );
}

export default withLayout;
